import React from 'react';
import './App.css';
import UserProfile from './components/UserProfile';

class App extends React.Component {
  render() {
    const joao ={
      id: 1,
      name: 'João da Silva',
      email: "joao@gmsil.com",
      author: "https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_960_720.png"
    };
    const amelia = {
      id: 2,
      name: 'Amélia Ferreira',
      email: "amelia@gmail.com",
      author: "https://cdn.pixaby.com/photo/2016/08/20/05/38/avatar-1606916_640.png"
    }

    return (
      <div className="App">
        <UserProfile user={joao.author} />
        {/* <UserProfile user={amelia.id} /> */}

      </div>
    );
  }
}

export default App;
